pragma solidity ^0.5.0;

contract RegisterFactory {
    string public content;
    uint public contagemDeOcorrs = 0;
    mapping(uint => Task) public tasks;

    struct Task {
        uint id;
        string content;
        uint numReeggistro;
        address payable owner;
        bool completed;
    }

    event TaskCreated(
        uint id,
        string content,
        uint numReeggistro,
        address payable owner,
        bool completed
    );

    event TaskCompleted(
        uint id,
        string content,
        uint numReeggistro,
        address payable owner,
        bool completed
    );

    constructor() public {
        content = "Projeto Aplicado, IGTI, Manoel Souza";
    }

    function createTask(string memory _content, uint _numReeggistro) public {
        // Require a valid content
        require(bytes(_content).length > 0);
        // Require a valid numReeggistro
        require(_numReeggistro > 0);
        // Increment product count
        contagemDeOcorrs ++;
        // Create the task
        tasks[contagemDeOcorrs] = Task(contagemDeOcorrs, _content, _numReeggistro, msg.sender, false);
        // Trigger an event
        emit TaskCreated(contagemDeOcorrs, _content, _numReeggistro, msg.sender, false);
    }


}
